create table ordered_products
(
    ordered_products_id        int auto_increment
        primary key,
    order_id                   int          null,
    product_id                 int          null,
    attribute_id               int          null,
    selected_attribute_type_id int          null,
    item_id                    varchar(255) null,
    constraint ordered_products_ordered_products_id_uindex
        unique (ordered_products_id),
    constraint ordered_products_attribute_types_attribute_types_id_fk
        foreign key (selected_attribute_type_id) references attribute_types (attribute_types_id),
    constraint ordered_products_attributes_attribute_id_fk
        foreign key (attribute_id) references attributes (attribute_id),
    constraint ordered_products_orders_order_id_fk
        foreign key (order_id) references orders (order_id),
    constraint ordered_products_product_product_id_fk
        foreign key (product_id) references product (product_id)
);

